INSERT INTO `job_department` VALUES (1,'Người quản lý dự án. Vị trí này quản lý và điều phối các hoạt động của dự án từ đầu đến cuối, đảm bảo rằng dự án được triển khai thành công theo kế hoạch và đạt được mục tiêu được đề ra.','PM','Project Manager',40000000),(2,'Các nhân viên, thành viên trong tổ chức hoặc công ty. Thuật ngữ này thường ám chỉ đến những người làm việc trong một tổ chức, đội nhóm, hoặc bộ phận nào đó mà không phải là người đứng đầu hoặc quản lý.','Staff','Staff',7000000),(3,'Công việc của HR xoay quanh các hoạt động tuyển dụng, lên kế hoạch triển khai các chính sách phù hợp để duy trì nguồn nhân lực dồi dào cho công ty.','HR','HR',7000000),(4,'Intern đòi hỏi phải có thời gian hướng dẫn để xem xét xem có phù hợp với ngôn ngữ lập trình hoặc một dự án nào đó. Mà từ đó có thể quyết định rằng ký hợp đồng chính thức hay partime hoặc là vừa học vừa làm.','INTERN','Intern',3000000),(8,'Hệ thống checkin / checkout, đăng kí ảnh','TIMESHEET','System timesheet',0);
