INSERT INTO `project` VALUES (1,'CODE-20','Nền tảng quản lý hàng tồn kho hiệu quả với khả năng theo dõi, nhập, xuất và tổ chức kho hàng.','2024-04-24','Hệ Thống Quản Lý Kho','ACTIVE','MAINTAIN','2023-09-23'),(2,'CODE-10','Ứng dụng di động hỗ trợ quản lý đơn hàng, vận chuyển và giao hàng cho doanh nghiệp vận chuyển hàng hóa.','2024-11-09','Ứng Dụng Di Động Giao Hàng','ACTIVE','OUTSOURCE','2023-01-12'),(3,'CODE-11','Hệ thống học trực tuyến với các khóa học, bài giảng và kỹ thuật dạy học tiên tiến cho học sinh và giáo viên.','2024-01-14','Nền Tảng Học Trực Tuyến','ACTIVE','MAINTAIN','2023-02-15'),(4,'CODE-12','Ứng dụng hỗ trợ quản lý tài chính cá nhân, ghi chép chi tiêu, quản lý tài khoản ngân hàng và lập kế hoạch tài chính.','2024-06-27','Hệ Thống Tài Chính Cá Nhân','ACTIVE','OUTSOURCE','2023-05-28'),(5,'CODE-13','Nền tảng thương mại điện tử đa kênh kết nối người mua và người bán, hỗ trợ giao dịch, thanh toán và quản lý đơn hàng.','2024-02-26','Nền Tảng Thương Mại Điện Tử','ACTIVE','MAINTAIN','2023-05-24'),(6,'CODE-14','Dự án quản lý mật khẩu nhân viên','2024-08-20','Passbolt','ACTIVE','OUTSOURCE','2023-01-02'),(7,'CODE-15','Hệ thống xử lý và phân tích dữ liệu lớn với công nghệ hiện đại nhằm tối ưu hóa quy trình phân tích dữ liệu.','2024-07-25','Hệ Thống Xử Lý Dữ Liệu Lớn','ACTIVE','OUTSOURCE','2023-02-21'),(8,'CODE-16','Hệ thống quản lý sản phẩm, thông tin về sản phẩm và quy trình sản xuất hiệu quả.','2024-08-08','Hệ Thống Quản Lý Sản Phẩm','ACTIVE','MAINTAIN','2023-01-18'),(9,'CODE-17','Nền tảng xã hội kết nối cộng đồng, chia sẻ thông tin và tương tác.','2024-07-09','Nền Tảng Xã Hội','ACTIVE','MAINTAIN','2023-09-25'),(10,'CODE-18','Dự án game của vnpt, sự kiện tết','2024-07-12','GAMI','ACTIVE','OUTSOURCE','2023-09-29'),(11,'CODE-19','Hệ thống quản lý bán hàng, quản lý đơn hàng, khách hàng và doanh số bán hàng.','2023-12-15','Hệ Thống Quản Lý Bán Hàng','ACTIVE','MAINTAIN','2023-11-15'),(12,'CODE-0','Ứng dụng điều khiển thiết bị thông minh, điều khiển từ xa và tự động hóa.','2024-01-31','Ứng Dụng Điều Khiển Thông Minh','ACTIVE','OUTSOURCE','2023-10-18'),(13,'CODE-1','Hệ thống quản lý thông tin về khách hàng, thông tin liên hệ và lịch sử giao dịch.','2024-06-16','Hệ Thống Quản Lý Khách Hàng','ACTIVE','MAINTAIN','2023-06-17'),(14,'CODE-2','Ứng dụng với giao diện người dùng thân thiện, dễ sử dụng và hiệu quả.','2024-06-23','Ứng Dụng Giao Diện Đơn Giản','ACTIVE','MAINTAIN','2023-02-02'),(15,'CODE-3','Hệ thống định vị GPS với khả năng theo dõi vị trí và vận tốc chính xác.','2024-05-15','Hệ Thống Định Vị GPS','ACTIVE','MAINTAIN','2023-08-19'),(16,'CODE-4','Hệ thống quản lý và phân chia công việc, theo dõi tiến độ và hoàn thành công việc.','2024-05-02','Hệ Thống Quản Lý Tác Vụ','ACTIVE','OUTSOURCE','2023-03-29'),(17,'CODE-5','Ứng dụng sử dụng dữ liệu thời gian thực để hiển thị thông tin cần thiết.','2024-04-29','Ứng Dụng Dữ Liệu Thời Gian Thực','ACTIVE','PRODUCT','2023-09-12'),(18,'CODE-6','Nền tảng quản lý và vận hành công việc hàng ngày một cách hiệu quả.','2024-07-07','Nền Tảng Quản Lý Vận Hành','ACTIVE','OUTSOURCE','2023-01-31'),(19,'CODE-7','Hệ thống theo dõi chi phí, quản lý nguồn lực và dự toán chi phí.','2023-12-03','Hệ Thống Theo Dõi Chi Phí','INACTIVE','OUTSOURCE','2023-07-24'),(20,'CODE-8','Hệ thống quản lý dự án, theo dõi tiến độ và tài nguyên dự án.','2024-02-01','Hệ Thống Quản Lý Dự Án','INACTIVE','MAINTAIN','2023-08-03'),(21,'CODE-9','Ứng dụng theo dõi thông tin y tế cá nhân, lịch sử khám bệnh và hồ sơ sức khỏe.','2024-02-23','Ứng Dụng Theo Dõi Y Tế','ACTIVE','MAINTAIN','2023-10-08');
